import React, {useEffect, useState} from 'react';
import axios from 'axios';
import swal from 'sweetalert2';
import withReactContent from 'sweetalert2-react-content';
import { show_alerta } from '../functions';

const ShowResult = () =>{

	const url = 'http://api-productos.run';
	const [results, setResultsAll] = useState([]);
	const [id, setId] = useState('');
	const [testid, setTestId] = useState('');
	const [testname, setTestName] = useState('');
	const [partnumber, setPartNumber] = useState('');
	const [serialno, setSerialNo] = useState('');
	const [datetime, setDatetime] = useState('');
	const [duration, setDuration] = useState('');
	const [defaults, setDefaults] = useState('');
	const [resultsc, setResultsc] = useState('');
	const [operation, setOperation] = useState(1);

	useEffect( ()=>{
		getResults();
	}, []);

	const getResults = async () => {
		//const respuesta = await axios.get(url);
		//setResultsAll(respuesta.data);
	}

	return (
		<div className='App'>
			<div className='container-fluid'>
				<div className='row mt-3'>
					<div className='col-md-4 offset-4'>
						<div className='d-grid mx-auto'>
							<button className='btn btn-dark' data-bs-toogle='modal' data-bs-target='modalResults'>
								<i className='fa-solid fa-circle-plus'></i>Añadir
							</button>
						</div>
					</div>
				</div>
				
				<div className='row mt-3'>
					<div className='col-md-4 offset-4'>
						<div className='table-responsive'>
							<table className='table table-bordered'>
								<thead>
									<tr><td>#</td><td>test</td><td>serialNo</td><td>duracion</td></tr>
								</thead>
								<tbody className='table-group-divider'>
									
								</tbody>
							</table>
						</div>
					</div>
				</div>
				
			</div>
			<div id='modalResults' className='modal fade' haria-hidden='true'>
				<div className='modal-dialog'>
					<div className='modal-content'>
						<div className='modal-header'>
							<label className='h5'>{title}</label>
							<button type='button' className='btn-close' data-bs-dismiss='modal' aria-label='Close'></button>
						</div>
						<div className='modal-body'>
							<input type='hidden' id='id'></input>
							<div className='input-group mb-3'>
								<span className='input-group-text'><i className='fa-solid fa-gift'></i></span>
								<input type='text' id='nombre' className='form-control' placeholder='Nombre' value={name} onChange={(e)=> setName(e.target.value)}></input>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	)
}

export default ShowResult
